import './Title.css';
function Title() {
    return (
        <div className='page'>
            <h1>Pagination</h1>
            <div className='underline'></div>
            <div className='container followers'>
                <div>1</div>
                <div>2</div>
                <div>3</div>
                <div>4</div>
            </div>
        </div>
    )
}
export default Title;
